pragma solidity ^0.5.0;

contract AssetsManagement {

  enum AccountType { DEALER, SERVICE_CENTER, DRIVER }
  enum AssetState { CREATED, CALIBRATED }

  struct ParticipantDetail {
    address client;
    AccountType accountType;
  }

  struct Asset {
    uint256 index;
    address creator;
    string Item;
    string SerialNumber;
    string DateCommissioned;
    address Administrator;
    AssetState state;
  }

  struct Calibration {
    uint256 index;
    uint256 assetIndex;
    string Date;
    string CalibrationType1;
    string CalibrationType2;
    string CalibrationType3;
    address CalibratedBy;
  }

  address public owner;
  uint256 public assetIndex;
  uint256 public calibrationsIndex;

  mapping(address => ParticipantDetail) public participants;
  mapping(uint256 => Asset) public assets;
  mapping(address => uint256[]) public assetsByCreator;
  mapping(address => uint256[]) public assetsByAdministrator;
  mapping(uint => uint256[]) public assetsByState;

  mapping(uint256 => Calibration) public calibrations;
  mapping(address => uint256[]) public calibrationsByCreator;

  address[] public allDrivers;

  // EVENTS

  event SignupEvent(address indexed sender, AccountType _type);
  event AddAssetEvent(address indexed sender, uint256 assetid);
  event AddCalibrationsEvent(address indexed sender, uint calibrationsid);

  // EVENTS ENDS

  modifier onlyOwner() {
    require(msg.sender == owner, "Sender is not owner.");
    _;
  }

  constructor() public {
    owner = msg.sender;
  }

  function signup(
    AccountType _type
  ) public {
    require(msg.sender != participants[msg.sender].client, "Sender is not yet signup");

    participants[msg.sender] = ParticipantDetail(msg.sender, _type);

    if(AccountType.DRIVER == _type){
      allDrivers.push(msg.sender);
    }

    emit SignupEvent(msg.sender, _type);
  }

  function getAllDrivers() public view returns (address[] memory){
    return allDrivers;
  }


  function addAsset (
    string memory item,
    string memory serialNumber,
    string memory dateCommissioned,
    address administrator
  ) public {

    require(
      participants[msg.sender].accountType == AccountType.DEALER,
      "Sender is not a dealer."
    );

    assetIndex++;
    assets[assetIndex] = Asset(
      assetIndex,
      msg.sender,
      item,
      serialNumber,
      dateCommissioned,
      administrator,
      AssetState.CREATED
    );

    assetsByCreator[msg.sender].push(assetIndex);
    assetsByAdministrator[administrator].push(assetIndex);
    assetsByState[uint(AssetState.CREATED)].push(assetIndex);

    emit AddAssetEvent(msg.sender, calibrationsIndex);
  }

  function getAssetByAdministrator(address _administrator) public view returns (uint256[] memory) {
    return assetsByAdministrator[_administrator];
  }

  function getAssetByCreator(address _creator) public view returns (uint256[] memory) {
    return assetsByCreator[_creator];
  }

  function getAssetByState (uint _status) public view returns (uint256[] memory) {
    return assetsByState[_status];
  }

  function addCalibration (
    uint256 _assetIndex,
    string memory _date,
    string memory _calibrationType1,
    string memory _calibrationType2,
    string memory _calibrationType3
  ) public {

    require(
      participants[msg.sender].accountType == AccountType.SERVICE_CENTER,
      "Sender is not a service center."
    );

    calibrationsIndex++;
    calibrations[calibrationsIndex] = Calibration(
      calibrationsIndex,
      _assetIndex,
      _date,
      _calibrationType1,
      _calibrationType2,
      _calibrationType3,
      msg.sender
    );

    calibrationsByCreator[msg.sender].push(calibrationsIndex);

    assets[_assetIndex].state = AssetState.CALIBRATED;
    assetsByState[uint(AssetState.CALIBRATED)].push(_assetIndex);

    for ( uint i=0; i<assetsByState[uint(AssetState.CREATED)].length; i++ ) {
      if(assetsByState[uint(AssetState.CREATED)][i] == _assetIndex){
        //assetsByState[uint(AssetState.CREATED)][i] = 0;
        delete assetsByState[uint(AssetState.CREATED)][i];
        break;
      }
    }

    emit AddCalibrationsEvent(msg.sender, calibrationsIndex);
  }

  function getCalibrationsByCreator(address _creator) public view returns (uint256[] memory) {
    return calibrationsByCreator[_creator];
  }
}
